script: |
  super -f text -I q9596.spq | sort > q9596.out

inputs:
  - name: q9596.spq
    data: |
      SELECT ALL col2 * - col2 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT ( col1 + col0 * + col2 + tab0.col0 ) IN ( col2 / col1 );
  - name: tab0

outputs:
  - name: q9596.out
    data: |
      -1
      -1089
      -6724
